Серия книг "Иллюстрированная история", ND PLAY, в увлекательной форме познакомит юных читателей с различными историческими эпохами. Издание дополнено яркими иллюстрациями. Без возрастных ограничений. Предназначено для чтения взрослыми детям. Формат: А3 (242х342 мм). Обложка из мелованного картона.

В ассортименте представлены: 
"Древний мир";
"Древний Египет";
"Древняя Греция";
"Древний Рим";
"Средние века";
"Дворцы и замки".

Серия книг "Умные прописи", ND PLAY, поможет подготовить ребёнка к школе. Содержание соответствует ФГОС дошкольного образования. Возрастное ограничение зависит от выбранного издания. Формат: 200х250 мм. Мягкая обложка. 

В ассортименте представлены:
"Готовим руку к письму";
"Пишем цифры";
"Пишем печатные буквы";
"Пишем письменные буквы";
"Пишем слоги";
"Пишем слова, словосочетания и предложения".

Серия раскрасок "Моя Большая Раскраска" порадует ребёнка иллюстрациями с любимыми персонажами! Цветная подсказка поможет с выбором подходящих оттенков. 

В ассортименте представлены:
"Три Кота";
"Цветяшки";
"Тоботы"; 
"Фиксики"; 
"Майнкрафт";
"LOL Surprise";
"Геройчики";
"Сказочный патруль";
"Дракошия";
"Шушу Магия";
"Отель "У овечек";
"Волшебные единороги";
"Мимимишки";
"Турбозавры".

Серия книг "Чудеса России" не только расскажет о самых известных зданиях страны, но и поможет собрать 3D-модели архитектурных строений своими руками. Мягкий переплёт. Формат А4. 

В ассортименте представлены:
"Петергоф";
"Калининград. Рыбная деревня";
"Храм Василия Блаженного";
"Кижи. Преображенская церковь".
